import React, { useState } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import { TextLogoIcon } from '../icons';
import { loginUser, fetchCurrentUser } from '../api'; // Import the login and fetchCurrentUser functions
import { GoogleOAuthProvider, GoogleLogin } from '@react-oauth/google';

function Login() {
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [rememberMe, setRememberMe] = useState(false);
  const navigate = useNavigate();

  const handleRememberMeChange = (event) => {
    setRememberMe(event.target.checked);
  };

  const handleSubmit = async (event) => {
    event.preventDefault();
    try {
      await loginUser({ email, password });
      if (rememberMe) {
        localStorage.setItem('rememberedEmail', email);
      } else {
        localStorage.removeItem('rememberedEmail');
      }

      const currentUser = await fetchCurrentUser();
      const userId = currentUser.userId;
      console.log('Logged in user ID:', userId);

      // Redirect to home or another page
      navigate('/dashboard'); 
    } catch (error) {
      console.error('Error logging in:', error);
    }
  };

  const handleGoogleLoginSuccess = async (response) => {
    console.log('Google login success:', response);
    // Handle successful Google login response, e.g., send the token to your backend
    try {
      // Assume your backend endpoint for Google login is /api/v1/user/google-login
      const res = await fetch('http://localhost:8080/api/v1/user/google-login', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify({ token: response.credential }),
      });
      const data = await res.json();
      console.log('Backend response:', data);
      const userId = data.userId;
      console.log('Logged in user ID:', userId);
      navigate('/dashboard');
    } catch (error) {
      console.error('Error logging in with Google:', error);
    }
  };

  const handleGoogleLoginFailure = (error) => {
    console.error('Google login failure:', error);
  };

  return (
    <GoogleOAuthProvider clientId="14917831936-biv2m65qncfl3tcvim3vv0o2nt0lc5ce.apps.googleusercontent.com">
      <div className="flex min-h-screen items-center justify-center bg-gray-100 py-12 sm:px-6 lg:px-8">
        <div className="sm:mx-auto sm:w-full sm:max-w-md">
          <div className="flex justify-center mb-4 pb-6">
            <TextLogoIcon className="h-8 w-auto" />
          </div>
          <div className="mt-8 sm:mx-auto sm:w-full sm:max-w-md">
            <div className="bg-white py-8 px-4 rounded-2xl border border-gray-200 sm:px-10">
              <h2 className="text-left text-2xl pb-6 font-medium text-gray-900">
                Sign in to your account
              </h2>
              <form className="space-y-6" onSubmit={handleSubmit}>
                <div>
                  <label htmlFor="email" className="block text-sm font-medium text-gray-700">
                    Email address
                  </label>
                  <div className="mt-1">
                    <input
                      id="email"
                      name="email"
                      type="email"
                      autoComplete="email"
                      required
                      value={email}
                      onChange={(e) => setEmail(e.target.value)}
                      className="block w-full appearance-none rounded-md border border-gray-300 px-3 py-2 placeholder-gray-400 focus:border-blueCustom focus:outline-none focus:ring-blueCustom sm:text-sm"
                    />
                  </div>
                </div>
                <div>
                  <label htmlFor="password" className="block text-sm font-medium text-gray-700">
                    Password
                  </label>
                  <div className="mt-1">
                    <input
                      id="password"
                      name="password"
                      type="password"
                      autoComplete="current-password"
                      required
                      value={password}
                      onChange={(e) => setPassword(e.target.value)}
                      className="block w-full appearance-none rounded-md border border-gray-300 px-3 py-2 placeholder-gray-400 focus:border-blueCustom focus:outline-none focus:ring-blueCustom sm:text-sm"
                    />
                  </div>
                </div>
                <div className="flex items-center justify-between">
                  <div className="flex items-center">
                    <input
                      id="remember-me"
                      name="remember-me"
                      type="checkbox"
                      checked={rememberMe}
                      onChange={handleRememberMeChange}
                      className="h-4 w-4 text-blueCustom focus:ring-blueCustom border-gray-300 rounded"
                    />
                    <label htmlFor="remember-me" className="ml-2 block text-sm text-gray-900">
                      Remember me
                    </label>
                  </div>
                </div>
                <div>
                  <button
                    type="submit"
                    className="w-full flex justify-center py-2 px-4 border border-transparent text-sm font-medium rounded-md text-white bg-blueCustom hover:bg-blue-600 focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-blueCustom"
                  >
                    Sign in
                  </button>
                </div>
                <div className="mt-6 text-center">
                  <p className="text-sm text-gray-600">
                    Not a member?{' '}
                    <Link to="/register" className="font-medium text-blueCustom hover:text-blue-600">
                      Create Account
                    </Link>
                  </p>
                </div>
              </form>
              <div className="mt-6">
                <GoogleLogin
                  onSuccess={handleGoogleLoginSuccess}
                  onFailure={handleGoogleLoginFailure}
                />
              </div>
            </div>
          </div>
        </div>
      </div>
    </GoogleOAuthProvider>
  );
}

export default Login;
